import React, { Component } from 'react';

class Movies extends Component {
    state = {
        movies: [
            { title: 'A', genre: 'AA' },
            { title: 'B', genre: 'BB' },
        ]
    }

    render() {
        return (
            <table className="table">
                <thead>
                    <tr>
                        <th>Title</th>
                        <th>Genre</th>
                        <th>Stock</th>
                        <th>Rate</th>
                    </tr>
                </thead>

                <tbody>
                    <tr>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                    </tr>
                </tbody>
            </table>

        );
    }
}

export default Movies;
